package com.csi.emphome.demo;

import com.csi.emphome.demo.domain.face.Face;
import com.csi.emphome.demo.service.face.*;
import org.json.JSONException;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;

import java.util.HashMap;

@SpringBootTest(webEnvironment = SpringBootTest.WebEnvironment.RANDOM_PORT)
public class Face_test {
    @Autowired
    FaceService faceService;

    @Test
    void faceListTest(){
        HashMap<String, Object> res = faceService.faceListFunc();
        System.out.println(res);
    }

    @Test
    void faceLoginTest() throws JSONException {
        Face face =new Face();
        face.setBase64("");
        HashMap<String, Object> res = faceService.serchFace(face);
        System.out.println(res);
    }

    @Test
    void faceAddTest() throws JSONException {
        Face face =new Face();
        face.setId(1);
        face.setBase64("");
        HashMap<String, Object> res = faceService.addFace(face);
        System.out.println(res);
    }

    @Test
    void faceDelTest(){
        Face face =new Face();
        face.setId(1);
        face.setBase64("");
        HashMap<String, Object> res = faceService.delFace(face);
        System.out.println(res);
    }
}
